import { CardActionArea, CardContent, CardMedia, Typography } from '@mui/material'
import React from 'react'

const EmployeeCard = ({name, title}) => {
  return (
    <CardActionArea component={Link} to={button.url} target="_blank">
        <CardMedia
        sx={{borderRadius: '50%'}}
        component="img"
        image="../images/holder_4.jpg"
        alt=""
        />
        <CardContent>
        <Typography variant="h6" sx={{textTransform: 'uppercase'}} color="text.secondary">
            {name}
        </Typography>
        <Typography variant="p" sx={{textTransform: 'uppercase'}} color="text.secondary">
            {title}
        </Typography>
        </CardContent>
    </CardActionArea>
  )
}

export default EmployeeCard
